import React, { Component } from 'react';
import JSON from '../services/data';

class Weather extends Component {
  constructor(props) {
    super(props);
    this.teste = this.teste.bind(this);
  }

  teste() {
    return (
    JSON.map((dataID) =>
      (
        <div key={dataID.name}>
          <p>{`${dataID.name} ${dataID.id}`}</p>
        </div>
      )
    ))
  }
  render() {
    return (
      <div>
        <p>{this.teste()}</p>
      </div>
    )
  }
}

export default Weather;
